     <div>
        <div>
          <span>Manage Employees</span>
        </div>
        <div>
          <button className='button1'>Delete</button>
          <button className='button2'>Add New Employee</button>
        </div>
      </div>
      <div className='table'>  
        <table border={1}>
          <thead>
            <th><input type="checkbox" name="checkbox1" id="ckbx" /></th>
            <th>Name</th>
            <th>Email</th>
            <th>Address</th>
            <th>Phone</th>
            <th>Action</th>
          </thead>
          <tbody>
            {
              records.map((d)=>(
                <tr >
                    <td><input type="checkbox" name={d.name} id={d._id} /></td>
                    <td>{d.name}</td>
                    <td>{d.email}</td>
                    <td>{d.address}</td>
                    <td>{d.phone}</td>
                    <td>
                      <button>Edit</button> || <button>Delete</button>
                    </td>
                </tr>              
              ))
            }
          </tbody>
        </table>
        <nav>
            <ul className='pagination'>
                <li className='page-item'>
                  <a href="#" className='page-link' onClick={prePage}>
                    Previous
                  </a>
                </li>
                {
                  numbers.map((i,n)=>(
                    
                    <li className={`page-item ${currentPage === n ? 'active' : '' }`} key={i}>
                        <a href="#" onClick={changeCPage(n)}>
                          {n}
                        </a>
                    </li> 
                  ))
                }


                <li className='page-item'>
                  <a href="#" className='page-link' onClick={nextPage}>
                    Next
                  </a>
                </li>
            </ul>
            
        </nav>
        </div>
  </>
    
  )
}

export default Crud
